import { faker } from '@faker-js/faker'
import _ from 'lodash'

import { IRecipeService } from '../Types'
import { Recipe, Instruction, Ingredient, PaginatedQuery } from '../../State/Types'

export default class FakeRecipeService implements IRecipeService {
    async getRecipes(request: PaginatedQuery) : Promise<Recipe[]> {
        return Promise.resolve(_.times(5, this.generateFakeRecipe))
    }

    async createRecipe(recipe: Recipe) : Promise<Recipe> {
        return Promise.resolve(
            { ...recipe,
                id: faker.datatype.uuid()
            });
    }

    generateFakeRecipe() : Recipe {
        return {
          id: faker.datatype.uuid(),
          title: faker.datatype.string(),
          imageData: undefined,
          ingredients: ingredients,
          instructions: instructions
        }
    }
}

const ingredients = [
    {
        text: "Celery"
    },
    {
        text: "Tomatoes"
    },
    {
        text: "Bread"
    },
] as Ingredient[]

const instructions = [
    {
        order: 1,
        text: faker.datatype.string()
    },
    {
        order: 2,
        text: faker.datatype.string()
    },
    {
        order: 3,
        text: faker.datatype.string()
    }
] as Instruction[]

export const imageData = ""